import ProductOrigin from "../static/ProductOrigin";

//参数 [int,int]
const handleAddress = (addressInt) => {
    //解析成字符串
    let sheng = addressInt[0];
    let shi = addressInt[1];

    let addressString = "";

    var queryData = ProductOrigin.filter(function(fp) {
        return fp.value === 1;
    })
    console.log("sheng = " + queryData[0].label);

    addressString += queryData[0].label + ", ";

    return addressString;
}

export default handleAddress;
